import axios from 'axios';
import React from 'react';

const baseUrl= "https://www.coingecko.com/ru/all-cryptocurrencies"

class Main extends React.Component {
    constructor(props)
    {
        super(props)
        axios.get(baseUrl).then((res)=>{
            console.log(res.data)
        })
    }
    render()
    {
        return (
            <div className="main">
                
                <img id='image' src="https://master-saydinga.ru/wp-content/uploads/kriptovalyuta.jpg"></img><br></br>
                <select id="list">
                    <option>Биткоин</option>
                    <option>Эфириум</option>
                    <option>Tether</option>
                    <option>BNB</option>
                </select><br></br>
                <input id="data" type="date" /><br></br>
                <button id="myButton" >Готово</button>
            </div>
        )
    }
}
export default Main
